import React, { Component } from 'react';
import {Helmet} from 'react-helmet';
import Image3 from '../products/09.jpg'
import './Carousel.css'


class ProductList extends Component {
    render() {
        return (
            <React.Fragment>

            <Helmet>
                <title>LiteCnC</title>
            </Helmet>
            <div class="hero">
            <div style={{ backgroundImage: `url(/public/img/09.jpg)` }}></div>
                 <div class="hero-text">
                     <h1>Do you wish to rent a car or a stay</h1>
                     <p>We provide a very affordable services from anywhere you are.</p>
                      <button>Book Now</button>
                 </div>
            </div>

            </React.Fragment>

        );
    }
}

export default ProductList;
